const intFields = ["age"];

class StudentData {
/* Code to seed the database
  static void load() {
    final CollectionReference studentsRef =
        Firestore.instance.collection('/students');

    final List<Map> smap = array2Map();
    for (var m in smap) {
      studentsRef.add(m);
    }
  }
  */

  static List<Student> getHarcodedData() {
    List<Student> students = [];

    final List<Map<String, dynamic>> smap = _array2Map();
    for (var m in smap) {
      Student s = Student.fromMap(m);
      students.add(s);
    }

    return students;
  }

  static List<Map<String, dynamic>> _array2Map() {
    final List<Map<String, dynamic>> smap = [];

    final len = students.length;

    NLog.log("Students count = $len");

    final String ttlRow = students[0];
    List<String> headers = ttlRow.split(',');
    List<String> fields = [];

    for (var h in headers) {
      h = h.replaceAll(' ', '');
      h = h.replaceAll('.', '');
      h = h.substring(0, 1).toLowerCase() + h.substring(1);
      fields.add(h);
    }
    final fieldCount = fields.length;
    NLog.log(fields);

    for (var i = 1; i < len; i++) {
      final String s = students[i];
      List<String> values = s.split(',');
      final valueCount = values.length;
      if (fieldCount == valueCount) {
        Map<String, dynamic> data = <String, dynamic>{};

        for (var f = 0; f < fieldCount; f++) {
          final String field = fields[f];
          final String value = values[f].replaceAll('"', '');
          final bool intField = intFields.contains(field);

          data[fields[f]] = intField ? int.parse(value) : value;

          NLog.log("${fields[f]} = ${values[f]}");
        }
        smap.add(data);
      } else {
        NLog.log("Error $fieldCount != $valueCount");
        exit(1);
      }
    }
    return smap;
  }
}
